INSERT INTO `wenzhang` VALUES (1, '社会', '“社交电商”项目管理原来如此简单（二十八）', '上篇我们介绍了“量化的项目管理”，战略管理(Strategic management)是指对一个企业或组织在一定时期的全局的、长远的发展方向、目标、任务和政策，以及资源调配做出的决策和管理艺术。', '上篇我们介绍了“量化的项目管理”，战略管理(Strategic management)是指对一个企业或组织在一定时期的全局的、长远的发展方向、目标、任务和政策，以及资源调配做出的决策和管理艺术。\n\n本篇我们重点了解“量化的项目管理”，即以工作细分结构(WBS结构)为横向，以项目计划为纵向，逐层深入地进行项目分项，甚至包括单体工作量及其所需人工、机械、费用等多项资源的分解，并根据项目控制总流程明确各阶段、各部门的工作内容、职责、管理程序和要求，建立与项目工作量分解系统相一致的进度控制系统、费用控制系统等，进行项目实施过程的动态跟踪、分析与管理，保证项目整体目标的实现。', 1, '1', '1', '2020-04-20 23:59:42', '');
INSERT INTO `wenzhang` VALUES (2, '经济', '跟瑞幸咖啡一样，美团的背后也是站着一群资本家', '最近，美团一直都是互联网上面的热点，我只要打开手机浏览器，莆田盖地都是美团的消息呀。\r\n\r\n究其原因，由于1月和2月新冠疫情的影响，美团成为了除口罩行业之外少有的赢家，在各地的开始进行如火如荼的复工复产时，', '<p>最近，美团一直都是互联网上面的热点，我只要打开手机浏览器，莆田盖地都是美团的消息呀。\r\n\r\n究其原因，由于1月和2月新冠疫情的影响，美团成为了除口罩行业之外少有的赢家，在各地的开始进行如火如荼的复工复产时，美团的赚钱业务也是开展得如火如荼，甚至有过之而无不及。\r\n\r\n这就是得益于受疫情的影响，大家普遍减少了堂食，增加了外卖的点单，美团成为了这场疫情之下因祸得福的幸运儿，得好处了遭人羡慕嫉妒恨这当然是很正常的，关注度高那肯定是妥妥的。\r\n\r\n于是，骄傲的美团自己感觉也是非常良好，一波骚操作惹来更大的争议，这里面争议最大的，当然是商家对美团佣金收费过高的投诉——美团的佣金比例高达26%，也就是我们点100块的外卖，美团要收去26元钱。很多小宝宝一定和我一样纳闷：外卖的配送费不都是我们出的吗？说实话我也看不懂，不过这个不重要，我也不做深究，反正知道是这么回事就行了。\r\n\r\n美团出来反驳说没有那么高，但是有食品行业的人出来说最低也有20%，并且拿出了数据。\r\n\r\n还有就是美团声称80%的佣金都是用于支付骑手工资的，但是较真的媒体偏偏扒出了美团的收入中骑手佣金只有70%多一点，虽然这个事情被美团解释过去了：美团的收入包括佣金和广告费，骑手工资确实占了佣金的80%。好吧，姑且我就相信你美团了。</p><p><img alt=\"1589108866143064299.jpg\" src=\"http://localhost:8888/simplebook/ueditor/jsp/upload/image/20200510/1589108866143064299.jpg\"/></p>', 2, '0', '0', '2020-05-19 19:41:05', NULL);
INSERT INTO `wenzhang` VALUES (4, '科技', '如何运用媒体打造出网红产品？', '天下公司千千万，打造出网红产品的公司却屈指可数，每个公司想网红产品久矣，什么时候自家的产品也能成为网红产品，火一把呢？这个首先要问自己，懂不懂打造网红产品的套路，如果不懂，有生之年是没戏了。就像让一个', '<p>天下公司千千万，打造出网红产品的公司却屈指可数，每个公司想网红产品久矣，什么时候自家的产品也能成为网红产品，火一把呢？这个首先要问自己，懂不懂打造网红产品的套路，如果不懂，有生之年是没戏了。就像让一个不会开车的人，去参加赛车比赛，能赢才怪。</p><p>打铁还需自身硬，打造网红产品要自己懂才是王道。这里单独把打造网红产品模块中，比较重要的媒体模块拿出来给大家讲讲，主要是小红书、微博、快手、淘宝、新闻媒体，这几个媒体（渠道），给大家讲下它们在打造网红产品过程中，各自扮演的角色和起的作用，学会了这些，对大家打造网红产品会很有帮助哦。</p><p>先用一句话概述他们的作用：小红书种草，微博做声量，快手带货，淘宝做收口，新闻媒体做背书，一套下来，又一个网红品牌就是你们了！</p><p><strong>小红书种草</strong></p><p>种草也就是引流，现在淘系内的广告价格颇高，站外引流的成本相对要低很，但对技能的要求更高。做直通车，花钱就行，排名上不去，加钱，还上不去，继续加钱，简单粗暴，会花钱的人都做的来。站外引流就不一样了，内容做不好，达人没选对，推广节奏没把控好，站外引流就做不起来，而最难的一点是站外引流，两个平台的数据是脱节的，不好分析数据，评估效果。</p><p>小红书种草是站外引流的绝佳平台，商家也可以入驻小红书开通官方商城，在小红书平台成交。但是目前主流的玩法是在小红书平台铺内容，用户对产品有兴趣，转而去淘宝平台购买。这是一个安利的过程，如果达人发布的日记里面放上商城链接，推广的意图过于明显，转化未必如不放链接的好些。</p><p>给大家分享个不花钱做小红书种草的窍门，我们在小红书上一分钱没有花，搜品牌词或者行业关键词，有近百篇日记都排在前面，记住是一分钱都没有花。那么是如何做到的呢？这里先说一个词：无费置换，意思是商家提供产品，达人试用后免费发布日记。所以，你懂的。</p><p>最开始我以为只有几百粉丝的达人会做无费置换，后来竟然找到了几万粉丝的达人，要知道，如果做付费推广，这几万粉丝的达人收费在2000元左右呢，就这样悄咪咪的剩下了万把块钱的推广费用（找了好几个免费发布的万粉达人），我真的是太机智了。</p><p>产品初期做小红书，做站外引流，做到一定程度会遇到瓶颈，毕竟小红书的量级有限，想做全民性的网红产品，单做小红书是不够的，就必须开拓第二战场：微博。</p><p><strong>微博做声量</strong></p><p>小红书千好万好，唯一的不好是没有热搜。意思是推广的再好，也不会形成话题，而微博是形成话题的不二之选。那些动不动上了热搜的产品，不都是一个个的网红产品吗？微博给人的感觉是一个广场，广场里喊一声，广场外的人都能听到，产品想做网红产品，必须要有声量，给B端企业听的，给投资机构听的，这个声量就要在微博平台来做了。</p><p>微博推广一圈下来，可以明显发现，微博的粉丝不如其他平台的值钱。小红书上一千个粉丝的，算是不错的素人了，微博上至少要一万粉丝才能与之持平。内容的形式两者差不多，九图加文案，也可以视频。不过，在推广产品时，我更倾向于图文类的推广。</p><p>好看的图片冲击力、记忆力更加强，视频很难让人记住，除非砸一亿推广费用，霸屏抖音，否则几万块的短视频推广扔下去，连个水花都看不到。微博可以采用小红书类似的推广方式，也能做无费置换，当铺垫的数量差不多了，就可以花点钱，找几个大号，搞个话题，想办法做个热搜了，热搜一起，声量暴增，全公司吃酒。</p><p><strong>快手带货</strong></p><p>带货平台哪家强？短视频平台找快手。也有很多做产品推广的人问我，大家都做抖音，为啥你不讲讲抖音呢？这可能就是认知误区了，就像河南本地没有强势的酒品牌，大家就以为那个地方的渠道是最好做的了。的确，所有做酒的都是这样想的，第一站都选在了河南，结果反而成为竞争最激烈的省份。</p><p>抖音的确很火，火的是内容，不是品牌。可以仔细回忆下，抖音推起来的品牌有哪些？反正我的印象里是没有，而通过快手带货赚了大钱的企业倒是不少。在打造网红产品时，快手带货是做为备选项的，可以做也可以不做。产品的声量一旦起来，会进入收割阶段，直播带货是收割的一种方式。</p><p><strong>淘宝做收口</strong></p><p>淘宝的角色越来越接近于交易平台了，当然这不是淘宝希望看到的。当初淘宝限制百度的抓取就是不希望流量掌握在别人手里。但是，站外引流的趋势不可阻挡，今天是小红书，明天还有小绿书等等。想做网红产品，对淘宝的定位一定要有清晰的认知，前期做交易平台，后期声量起来，在抓淘系内的流量。</p><p>在科普下收口这个词，举个例子，假如公司的产品在电视上打广告，每天24小时播放，用户被产品洗脑了，十分的想要，电视上又不可能下单，怎么办呢？用户就会去淘宝上搜索，下单购买。淘宝这时的作用就是流量的收口，把广告吸引到的用户，全都收过来变现，类似条条大路最后都汇入罗马一样。</p><p>淘宝做收口最要紧的是把关键词设置好，千万不要被别人截流去，不然就是为他人做嫁衣了。还有就是在产品推广之前，淘宝就要提前上架了，把素材做的好看些，评论优化下，等流量进来时，保证一个正常的转化率是很重要的。</p><p><strong>新闻媒体做背书</strong></p><p>这个模块很多人不知道，也不会做。经常会出现前面几个模块都做的很好，唯独这个模块没有做，打造网红产品的临门一脚没有踢出去，最后功亏一篑。如果没有新闻媒体做背书，网红产品只能是自嗨，自己知道没什么卵用。</p><p>新闻媒体指的是人民网、新浪网、搜狐网、凤凰网、财经网、地方性网站等等有权威的媒体。有个朋友就是做这种媒体的，我在做tob业务时，每个月都会给几千块他们，让他们帮忙发布到这些媒体上面，当用户了解产品信息时，看到产品在这些媒体上有曝光，会增加信任感，促进转化。</p><p>做新闻媒体，内容要自己出，也可以找代写的，比如类似某某新品日销量400万，成为某品类增长黑马；这样的新闻多投几篇，投的多了，自己也就信了，不管是用户还是渠道，看到这样的新闻，也会提升品牌是个网红产品的认知，久而久之，看的人多了，写的人多了，网红产品就不知不觉的出来了。</p><p><strong>最后</strong></p><p>把这些平台融汇贯通的玩转好，做一个网红产品出来并不难。在实操过程中，也不用完全照搬，可以根据公司产品上新的节奏，公司的实力做细微的调整，每家公司都有每家公司的脾气，找到适合自己的推广方式，搞定小红书、微博、淘宝、新闻媒体这几个平台，什么网红产品，想做几个就做几个！</p><p>作者：老虎讲运营，运营推广大牛，五十万字运营推广干货知识输出，千万流水项目操盘手，专注产品运营推广，精通运营推广的各个模块，号称运营推广老司机。</p>', 1, '0', '0', '2020-05-19 19:46:01', NULL);
INSERT INTO `wenzhang` VALUES (8, '社会', '丰巢收费的背后，只不过是资本的肆无忌惮', '这几天来自丰巢收费的舆论热度真的不低，我作为一个前行业者来给大家分析一下背后事情自丰巢在5月初开始要向用户收取超时费之后，网络舆论掀起了一层又一层的大浪。网上很多用户基本都在表示：“快递都不送上门了，还', '<h1 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; color: rgb(64, 64, 64); text-rendering: optimizelegibility; font-size: 26px; font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">这几天来自丰巢收费的舆论热度真的不低，我作为一个前行业者来给大家分析一下背后事情<img src=\"http://localhost:8888/simplebook_war22//ueditor/jsp/upload/image/20200519/1589888513378062711.jpg\" title=\"1589888513378062711.jpg\" alt=\"4.jpg\" width=\"749\" height=\"361\"/></h1><p><br/></p><p>自丰巢在5月初开始要向用户收取超时费之后，网络舆论掀起了一层又一层的大浪。</p><p>网上很多用户基本都在表示：“快递都不送上门了，还未经同意就丢快递柜里面。现在还要倒收我钱，有脸没脸。”</p><p>甚至还有物业要把丰巢赶出去小区停用小区来抵制丰巢收费</p><p><br/></p><h1 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 16px; color: rgb(64, 64, 64); text-rendering: optimizelegibility; font-size: 26px; font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://localhost:8888/simplebook_war22//ueditor/jsp/upload/image/20200519/1589888545610013699.jpg\" title=\"1589888545610013699.jpg\" alt=\"5.jpg\"/></h1><p><br/></p><p><span style=\"color: rgb(64, 64, 64); font-family: -apple-system, BlinkMacSystemFont, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Segoe UI&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(255, 255, 255);\">但是丰巢的回应用户是，我道歉但是我还是要收费。</span></p><p><br/></p><p><img src=\"http://localhost:8888/simplebook_war22//ueditor/jsp/upload/image/20200519/1589888613532012843.jpg\" title=\"1589888613532012843.jpg\" alt=\"6.jpg\" width=\"640\" height=\"1390\"/></p><p><br/></p>', 2, '1', '0', '2020-05-19 19:44:55', NULL);
INSERT INTO `wenzhang` VALUES (9, '杂谈', '读书——人总要死的，因为生着。', '生死场里的，忙着生，忙着死，人，动物，任何生命，一直是这样45345终于读完了萧红的《生死场》，意犹未尽，虽然读完了最后一个字一个标点符号，但是觉得故事仍然在继续着，生和死，永远不会结束。月英死了。大狗在草', '<p>生死场里的，忙着生，忙着死，人，动物，任何生命，一直是这样45345</p><p>终于读完了萧红的《生死场》，意犹未尽，虽然读完了最后一个字一个标点符号，但是觉得故事仍然在继续着，生和死，永远不会结束。</p><p>月英死了。</p><p>大狗在草堆上生产。</p><p>五姑姑的姐姐生了，孩子当时就死了。</p><p>金枝生了小金枝。</p><p>麻面婆生了孩子。</p><p>猪在生小猪。</p><p>王婆服毒。又活过来了。</p><p>小金枝一个月被爹爹摔死了。</p><p>日本人来了，死的人更多了。</p><p>金枝进城了。又回来了。</p><p>二里半的麻婆子被杀，罗圈腿被杀。</p><p>北村的一个老婆婆带着三岁的孙女吊死了。</p><p>李青山要进城参加革命军了，二里半泪别他的老羊，跟上李青山。</p><p>萧红的文字从来都让我惊喜，又让我放不下，一直在脑袋里。读着她笔下的生死场，想着的是我所在的生死场。</p><p>新冠肺炎感染了全世界的人，每天都在有人死去。这一年死去了太多的人。</p><p><img src=\"http://localhost:8888/simplebook_war22//ueditor/jsp/upload/image/20200519/1589885468212011753.jpg\" title=\"1589885468212011753.jpg\" alt=\"1.jpg\" width=\"738\" height=\"257\"/></p><p>这不仅仅是数据，是生命，是死亡。</p><p>人总要死的，因为人是生着的，是活着的。小时候不懂死亡是什么，随着年龄的增长，发现身边的生命多了，死亡也多了。慢慢的学会接受，慢慢的学着珍惜。</p><p>失去长辈，有了下一代。生老病死，循环往复，永不间断，总有一天我会变成长辈，总有一天我会死去，因为我是生着的。</p><p>但是在死之前可以完成梦想，可以坚持理想，可以和爱的人在一起，可以子女健康的人是幸福的，因为还有很多人没有准备好就离开了，结束了他的生死场。</p><p>所以要好好的生，最后，安然的死。</p>', 2, '0', '0', '2020-05-01 15:09:34', NULL);
INSERT INTO `wenzhang` VALUES (10, '杂谈', '时光无言，沉默是金', '01没有什么比时间更具有说服力了，因为时间无需通知我们就可以改变一切。02最初我们来到这个世界，是因为不得不来；最终我们离开这个世界，是因为不得不走。03以笑的方式哭，在死亡的伴随下活着。04人是为活着本身而', '<p><img src=\"http://localhost:8888/simplebook_war22//ueditor/jsp/upload/image/20200519/1589888939108060106.jpg\" title=\"1589888939108060106.jpg\" alt=\"7.jpg\" width=\"757\" height=\"403\"/></p><p>01<br/></p><p><br/></p><p>没有什么比时间更具有说服力了，因为时间无需通知我们就可以改变一切。</p><p>02</p><p><br/></p><p>最初我们来到这个世界，是因为不得不来；最终我们离开这个世界，是因为不得不走。</p><p>03</p><p><br/></p><p>以笑的方式哭，在死亡的伴随下活着。</p><p>04</p><p><br/></p><p>人是为活着本身而活着，而不是为了活着之外的任何事物所活着。</p><p>05</p><p><br/></p><p>做人不能忘记四条，话不要说错，床不要睡错，门槛不要踏错，口袋不要摸错。</p><p>06</p><p><br/></p><p>生的终止不过一场死亡，死的意义不过在于重生或永眠。死亡不是失去生命，而是走出时间。</p><p>07</p><p><br/></p><p>少年去游荡，中年想掘藏，老年做和尚。</p><p>08</p><p><br/></p><p>人啊，活着时受了再多的苦，到了快死的时候也会想个法子来宽慰自己。</p><p>09</p><p><br/></p><p>做人还是平常点好，争这个争那个，争来争去赔了自己的命。像我这样，说起来是越混越没出息，可寿命长，我认识的人一个挨着一个死去，我还活着。</p><p>10</p><p><br/></p><p>“人只要活得高兴，穷也不怕。”</p><p>11<br/></p><p><br/></p><p>他们脸上的皱纹里积满了阳光和泥土，他们向我微笑时，我看到空洞的嘴里牙齿所剩无几。</p><p>他们时常流出浑浊的眼泪，这倒不是因为他们时常悲伤，他们在高兴时甚至是在什么事都没有的平静时刻，也会泪流而出。<br/></p><p>然后举起和乡间泥路一样粗糙的手指，擦去眼泪，如同掸去身上的稻草。</p><p>12</p><p><br/></p><p>万事都一笑而过，还有什么意思呢？</p><p>13</p><p><br/></p><p>作家的使命不是发泄，不是控诉或者揭露，他应该向人们展示高尚。这里所说的高尚不是那种单纯的美好，而是对一切事物理解之后的超然，对善与恶一视同仁，用同情的目光看待世界。</p><p>14</p><p><br/></p><p>检验一个人的标准，就是看他把时间放在了哪儿。别自欺欺人；当生命走到尽头，只有时间不会撒谎。</p><p>15</p><p><br/></p><p>老子就是啃你家祖坟里的烂骨头，也不会向你要饭。</p><p>16</p><p><br/></p><p>女人都是一个心眼，她认准的事谁也不能让她变。</p><p>17</p><p><br/></p><p>活着是自己去感受活着的幸福和辛苦，无聊和平庸；幸存，不过是旁人的评价罢了。</p><p>18</p><p><br/></p><p>人都是一样的，手伸进别人口袋里掏钱时那个眉开眼笑，轮到自己给钱了一个个都跟哭丧一样。</p><p>19</p><p><br/></p><p>生命中其实是没有幸福或者不幸的，生命只是活着，静静地活着，有一丝孤零零的意味。</p><p>20</p><p><br/></p><p>被命运碾压过，才懂时间的慈悲。</p>', 1, '2', '2', '2020-05-19 19:49:30', '热门');

